import Inicio from './Pages/Inicio.tsx'
import Developer from './Pages/Developer.tsx'
import Marketer from './Pages/Marketer.tsx'
import { useCroct } from '@croct/plug-react';
import Hacker from './Pages/Hacker.tsx'
import { Route, BrowserRouter, Routes } from 'react-router-dom';
import {CroctProvider} from '@croct/plug-react';
import React from 'react';
function App() {
  const croct = useCroct();
  croct.user.edit().clear('custom.persona').save();
    return (
      <CroctProvider appId="00000000-0000-0000-0000-000000000000">
          <BrowserRouter>
          <Routes>
        <Route path="/" element={<Inicio/>}/>
        <Route path="/developer" element={<Developer/>}/>
        <Route path="/marketer" element={<Marketer />}/>
        <Route path="/hacker" element={<Hacker/>}/>
        </Routes>
    </BrowserRouter>
    </CroctProvider>

    );
  }
export default App;
